import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import './App.css';
import Header from './Header/Header';
import Banner from './Banner/Banner';
import Movie from './Movie/Peliculas';

function App() {
  return ( 
    <Router>
      <Routes>
      <Route path='Movie' element={<Movie />} />
      </Routes>



    <Header />
    <Banner />
    </Router>

  );
}

export default App;
